import React from "react"
import ReactDOMClient from "react-dom/client"
import { k } from './tariffs'
import { SetMainPage } from './index'
import { VideoChat } from './videochat'

var UserPage = {
	Name: "Name",
	Speed: "Speed",
	Cost: "Cost",
	IDtariff: "IDtariff",
	IDClient: "IDClient",
	Role: "Role",
	AccountNumber: "AccountNumber",
	Balans: "Balans",
	FIO: "FIO",
	Address: "Address",
	Mobile: "Mobile",
	email: "email"
}

function getCookie(cname) {
  var name = cname + "=";
  var ca = document.cookie.split(';');
  for (var i = 0; i < ca.length; i++) {
    var c = ca[i];
    while (c.charAt(0) === ' ') {
      c = c.substring(1);
    }
    if (c.indexOf(name) === 0) {
      return c.substring(name.length, c.length);
    }
  }
  return "";
}

function ShowUserInfo() {
  return (
    <div id="userFullInfo">
      <div id="inf">
        <p id="ul">Ваш логин: {getCookie("login")}</p>
        <p id="utn">Ваш тариф: {getCookie("tName")}</p>
        <p id="uts">Скорость тарифа: {getCookie("tSpeed")} Mbit/s</p>
        <p id="utc">Стоимость тарифа: {getCookie("tCost")} руб.</p>
        <button>Сменить пароль</button>
      </div>
      <div id="inf">
        <p>ФИО:</p>
        <p>Адрес:</p>
        <p>Мобильный:</p>
        <p>E-mail:</p>
        <button>Изменить данные</button>
      </div>
      <div id="inf">
        <p>Номер счёта:</p>
        <p>Баланс:</p>
        <button>Оплатить</button>
      </div>
    </div>
  )
}

function show() {
  const userSettings = ReactDOMClient.createRoot(document.getElementById("userInformation"));
  userSettings.render(<ShowUserInfo />);
}

function Iii() {
  return (
    <div>
      <h1><a href="/" style={{ color: "brightblue" }}>Личный кабинет</a></h1>
      <div id="userSettings">
        <a><p onClick={show}>Личная информация</p></a>
        <a><p>Поддержка</p></a>
        <a><p>Информация договора</p></a>
        <a><p onClick={exit}>Выйти</p></a>
      </div>
      <div id="userInformation">
        <div id="inf">
          <p>Номер счёта:</p>
          <p>Баланс:</p>
          <button>Оплатить</button>
        </div>
      </div>
    </div>
  )
}

function Iii2() {
  return (
    <div>
      <h1>Личный кабинет</h1>
      <p id="ul">Ваш логин: {getCookie("login")}</p>
      <button onClick={exit}>Выйти</button>
      <button onClick={VideoChat}>Смотреть трансляцию</button>
    </div>
  )
}

function exit() {
  document.cookie = "login=0;max-age=0";
  document.cookie = "password=0;max-age=0";
  app.render(<SetMainPage />);
}

const app = ReactDOMClient.createRoot(document.getElementById("app"))

export function SetUserPage() {

  const request = new XMLHttpRequest();

  const url = "http://localhost:8080/lk";

  const params = "login=" + getCookie("login") + "&password=" + getCookie("password");

  request.open("POST", url, true);

  request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

  request.addEventListener("readystatechange", () => {

    if (request.readyState === 4 && request.status === 200 && request.responseText != "You no login!") {
      const obj = JSON.parse(request.responseText);
      document.cookie = "tName=" + obj.Name;
      document.cookie = "tSpeed=" + obj.Speed;
      document.cookie = "tCost=" + obj.Cost;
      var role = obj.Role;
      if (role == 0) {
        app.render(<Iii />);
      }
    } else {
      app.render(<Iii2 />);
    }
  });

  request.send(params);
}

export function gc(cname) {
  return getCookie(cname);
}
